'use strict';

import type MediaStreamError from './MediaStreamError';

export default class MediaStreamErrorEvent {
  type: string;
  error: ?MediaStreamError;
  constructor(type, eventInitDict) {
    this.type = type.toString();
    Object.assign(this, eventInitDict);
  }
}
